      "type": "contributing_factor"
    },
    {
      "source": "Cha\u0142upki Level Crossing Accident 20/02/2023",
      "target": "Installation of lockable half-barriers on the exit lane from the level crossing, which prevented raising them manually.",
      "type": "contributing_factor"
    },
    {
      "source": "Cha\u0142upki Level Crossing Accident 20/02/2023",
      "target": "Failure to implement recommendation no. 2) in Point 4.2 of the PKBWK's Annual Report 2018 concerning disassembly of exit barriers.",
      "type": "contributing_factor"
    },
    {
      "source": "Cha\u0142upki Level Crossing Accident 20/02/2023",
      "target": "Following the introduction of the rule on the obligation of vehicle drivers to give way to pedestrians at a pedestrian crossing there had been no changes in the organisation of traffic, which forced the driver to stop in the crossing's danger zone.",
      "type": "systemic_factor"
    },
    {
      "source": "Cha\u0142upki Level Crossing Accident 20/02/2023",
      "target": "Absence of rules on positioning pedestrian crossings at level crossings in the implementing provisions to the Construction Law.",
      "type": "systemic_factor"
    }
  ]
}

